import Fetch from 'isomorphic-unfetch';
import Link from 'next/link';

const News = props => (
  <div>
    <p>{props.newsList.totalResults}</p>
    {props.newsList.articles.map((e, index) => (
      <div key={index}>
        <ul className="list-group">
          <li className="list-group-item">{`Title: ${e.articles.title}`}</li>
          <li className="list-group-item">{`Author: ${e.articles.author}`}</li>
        </ul>
        <br />
      </div>
    ))}
  </div>
);
export default News;
